import { Typography } from 'antd'
import './home-page.css'

const { Title } = Typography

const titleStyle = {
    color: '#ffffff',
    margin: 0,
    textAlign: 'center'
}

const HomePage = () => {
    return(
        <div className='home-page'>
            <Title style={titleStyle}>VEGA PROJECT ADMIN</Title>
        </div>
    )
}

export default HomePage
